import './App.css';
import Nav from './Components/Nav';
import { BrowserRouter,Route,Routes } from 'react-router-dom';
function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Route>
        <Routes/>
      </Route>
      </BrowserRouter>
      <Nav/>
    </div>
  );
}

export default App;
